import React from 'react';
import Box from '@mui/material/Box';
import Stepper from '@mui/material/Stepper';
import Step from '@mui/material/Step';
import StepLabel from '@mui/material/StepLabel';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { TextField } from '@mui/material';
import axios from 'axios';
import { useEffect } from 'react';



const CadGrt = () => {

  const steps = ['Buscar Veículo', 'Conferindo Veículo', 'Inserindo GRT','Validando Digital'];

  const [activeStep, setActiveStep] = React.useState(0);
  const [dado, setDado] = React.useState('')
  const [resposta, setResporta] = React.useState()

  console.log(dado, activeStep)

  const ConsultaPlaca = (e) => {
    axios.get(`http://localhost:3005/ConsultaGRT`, {
                params: {
                    dado: e,
                }
            })
            .then((res) => {
                const { BASE_AGREGADOS } = res.data.RESPOSTA
                console.log(BASE_AGREGADOS)
                setResporta(BASE_AGREGADOS)
            })
            .catch((err) => {
                console.log(err)
            })
  }

  const handleNext = () => {
    if ((activeStep === 0) && (dado === '')) {
      console.log('Placa vazia')
    } else {
      console.log('Placa preenchida');
      setActiveStep((prevActiveStep) => prevActiveStep + 1);
      ConsultaPlaca(dado)
    }
  };

  

  const handleBack = () => {
    setActiveStep((prevActiveStep) => prevActiveStep - 1);
  };

  const handleReset = () => {
    setActiveStep(0);
  };

  const Passo1 = () => {
    return(
        <div className='placa--input'>
          <TextField id='placa' name='placa' onBlur={(e) => setDado(e.target.value)} label='Placa' size='small' defaultValue={dado} fullWidth/>
          <p>*Digite a placa e clique em PRÓXIMO</p>
        </div>
    )
  }

  const Passo2 = () => {
    if (resposta) {
      return(
        <div className='placa--input'>
          <p>Veículo: {resposta.MarcaModelo}</p>
          <p>Ano Modelo: {resposta.AnoModelo}</p>
          <p>Ano Fabricação: {resposta.AnoFabricacao}</p>
          <p>Chassi: {resposta.chassi}</p>
          <p>Motor: {resposta.Motor}</p>
          <p>Marca: {resposta.Fabricante}</p>
        </div>
    )
    } else {
      return(
        <div className='placa--input'>
          <p>Carregando!!!</p>
        </div>
      )
    }
  }
  const Passo3 = () => {
    return(
      <div>
        <div className='placa--input'>
          {/* <TextField onChange={cadastro} label='Placa' size='small' fullWidth/><p>tesssssssssssste</p> */}
        </div>
      </div>
    )
  }
  const Passo4 = () => {
    return(
      <div>
        <div className='placa--input'>
          {/* <TextField onChange={(e) => setDado(e.target.value)} label='Placa' size='small' fullWidth/><p>tesssssssssssste</p> */}
        </div>
      </div>
    )
  }


  return (
    <Box sx={{ width: '100%' }}>
      <Stepper activeStep={activeStep}>
        {steps.map((label, index) => {
          const stepProps = {};
          const labelProps = {};
          return (
            <Step key={label} {...stepProps}>
              <StepLabel {...labelProps}>{label}</StepLabel>
            </Step>
          );
        })}
      </Stepper>
      {activeStep === steps.length ? (
        <React.Fragment>
          <Typography sx={{ mt: 2, mb: 1 }}>
            All steps completed - you&apos;re finished
          </Typography>
          <Box sx={{ display: 'flex', flexDirection: 'row', pt: 2 }}>
            <Box sx={{ flex: '1 1 auto' }} />
            <Button onClick={handleReset}>Reset</Button>
          </Box>
        </React.Fragment>
      ) : (
        <React.Fragment>
          <Typography sx={{ mt: 2, mb: 1 }}>Passo {activeStep + 1}</Typography>
          
          {activeStep === 0 ? <Passo1 /> : null}
          {activeStep === 1 ? <Passo2 e={resposta} /> : null}
          {activeStep === 2 ? <Passo3 /> : null}
          {activeStep === 3 ? <Passo4 /> : null}

          <Box sx={{ display: 'flex', flexDirection: 'row', pt: 2 }}>
            <Button
              color="inherit"
              disabled={activeStep === 0}
              onClick={handleBack}
              sx={{ mr: 1 }}
            >
              Voltar
            </Button>
            <Box sx={{ flex: '1 1 auto' }} />

            <Button onClick={handleNext}>
              {activeStep === steps.length - 1 ? 'Finalizar' : 'Próximo'}
            </Button>
          </Box>
        </React.Fragment>
      )}
    </Box>
  );
}
export default CadGrt
